import styled from 'styled-components'
import { Container, Title } from '../components/Components'

const Summary = ({ styles }) => {
  return (
    <Container style={{ height: '100vh' }}>
      <Title size={styles.titles.t2}>Summary</Title>
    </Container>
  )
}

export default Summary
